function Janela({ buscarJson, conteudoJson }) {
  return (
    <div className="janela">
      <button onClick={() => buscarJson("cliente")}>Carregar Cliente</button>
      <button onClick={() => buscarJson("produto")}>Carregar Produto</button>

      {conteudoJson && (
        <div className="json-content">
          <h3>Conte√∫do do JSON:</h3>
          <pre>{JSON.stringify(conteudoJson, null, 2)}</pre>
        </div>
      )}
    </div>
  );
}

export default Janela;
